import React, { useState, Component } from 'react';
import { Text, TextInput, View, Button } from 'react-native';
import { styles } from '../Styles';
import * as Google from 'expo-auth-session/providers/google';
import * as WebBrowser from 'expo-web-browser';
import * as Linking from 'expo-linking';

WebBrowser.maybeCompleteAuthSession();

export function LoadLoginPage({ route, navigation }) {



  const [userName, setUserName] = React.useState();

  const [request, response, promptAsync] = Google.useAuthRequest({
    expoClientId: '806471521542-7k36fosa636pickaes2q3gpkdh2tifcj.apps.googleusercontent.com',
    androidClientId: '806471521542-5jnse22n0bn8ovklkllqo7db94n5k1qg.apps.googleusercontent.com',
    webClientId: '806471521542-7k36fosa636pickaes2q3gpkdh2tifcj.apps.googleusercontent.com',
  }, { "scheme": "wells" });

  if (route.params?.token) {
    getProfileInfo(route.params?.token);
  }
  React.useEffect(() => {


    if (response?.type === 'success') {
      const { authentication } = response;
      getProfileInfo(authentication.accessToken);

    } else {
      console.log(response);
    }

  });

  React.useEffect(() => {
    WebBrowser.warmUpAsync("com.vigneshprabhu.wells").then(r => console.log('warmed'));

    return () => {
        WebBrowser.coolDownAsync("com.vigneshprabhu.wells").then(r => console.log('cooled'));
    };
}, []);

  getProfileInfo = function (accessToken) {
    fetch('https://www.googleapis.com/oauth2/v1/userinfo?alt=json', { 'headers': { 'Authorization': 'Bearer ' + accessToken } })
      .then(response => response.json())
      .then(data => setUserName(data.name))
      //.then(() => navigation.navigate('dashBoard'));
  }
  extractAccesToken= function () {
    Linking.getInitialURL().then(a => {
      alert('URL:::'+a);   
    });
  }

  return (
    <View style={styles.container} >
      <View style={styles.top}>

      </View>
      <View style={styles.loginForm}>
        <Text style={styles.loginTitle}>SIGN IN </Text>
        <TextInput style={styles.loginButton} value={JSON. stringify(response)}></TextInput>

        <View style={styles.loginButton}><Button style={styles.loginButtonIn}
          title="Sign In With Google"
          onPress={async  () => {
            promptAsync().then(async val => {
              alert(val.authentication.accessToken);
            })}}

        /></View>
          <View style={styles.loginButton}><Button style={styles.loginButtonIn}
          title="Sign In With Google"
          onPress={() => {
            promptAsync({ useProxy: true ,showInRecents:true});
          }}
        /></View>
      </View>
    </View>);

}
